import React, {Component} from 'react';
import "./friendInfo.css"

class Index extends Component {
    render() {
        return (
            <div>
                <img src="./editBtn.png" alt=""/>
                <img src="./infoBtn.png" alt=""/>
                <img src="./deleteBtn.png" alt=""/>
            </div>
        );
    }
}

export default Index;
